import React from 'react';
import './styles/App.css';

const App: React.FC = () => {
  return (
    <div className="app">
      <header className="app-header">
        <h1 style={{ color: 'white' }}>AWS Architecture Challenge</h1>
      </header>
      <main className="app-content">
        <div style={{ color: 'white' }}>
          Test Content - If you can see this, basic rendering is working
        </div>
      </main>
    </div>
  );
};

export default App;
